import Layout from '../components/Layout'
import Head from 'next/head';


function HomePage(){
  return (
    <>
      <Head>

      </Head>
      <body>
        Welcome to next JS. Are we good
        <Layout />
      </body>

      <style jsx>
        {`
        :root {
          /*  COLORS  */
          --color-primary: #ffffff;
          --color-secondary: #111111;
          --color-tertiary: #999999;
          --color-dim-white: #f5f5f5;
        }

        *,
        *::before,
        *::after {
          padding: 0;
          margin: 0;
          box-sizing: border-box;
          transition: all 0.3s ease-in-out;
        }

        html,
        body {
          width: 100%;
          min-height: 100vh;
        }

        html {
          font-size: 10px;
        }

        body {
          font-family: 'Nunito', -apple-system, BlinkMacSystemFont, "Segoe UI", Oxygen,
            Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif;

          font-size: 1.6rem;
          line-height: 1.5;
        }

        /* h1,
        h2,
        h3,
        h4,
        h5,
        h6 {

        } */

        a,
        a[href=""] {
          text-decoration: none;
        }


        /* Adding Container to the global */
        .container {
          width: 124rem;
          max-width: 100%;
          margin: 0rem auto;
        }
        @media (max-width: 1280px) {
          .container {
            padding: 0rem 10rem;
          }
        }

        @media (max-width: 768px) {
          .container {
            padding: 0rem 4rem;
          }
        }

        `}
      </style>
    </>
  )
}


export default HomePage
